import React, { Component } from 'react';
import { Navbar, Nav, FormControl, Container, Form, Button  } from 'react-bootstrap';
import logo from './logo192.png';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import Home from '../Pages/Home';

export default class Header extends Component {
    render() {
        return (
            <>
                <Navbar sticky="top" collapseOnSelect expand="md" bg="dark" variant="dark">
                    <Container>
                        <Navbar.Brand href="/">
                            <img
                                src={logo}
                                height="30"
                                width="30"
                                className="d-inline-block align-top"
                                alt="Logo"
                            />
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="header">
                                <Nav.Link href="/">Умный Зав. Лаб.</Nav.Link>
                                <Nav.Link href="/about">314</Nav.Link>
                                <Nav.Link href="/contacts">315</Nav.Link>
                                <Nav.Link href="/blog">316</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
                <Router>
                    <Routes>
                        <Route exact path="/" component={Home} />
                        <Route exact path="/about" component={314} />
                        <Route exact path="/contacts" component={315} />
                        <Route exact path="/blog" component={316} />
                    </Routes>
                </Router>      
            </>
        );
    }
}
